import React from "react";
import HomeIcon from "./HomeIcon/HomeIcon";
import TopbarNavigation from "./TopbarNavigation/TopbarNavigation";

export default class DarkMode extends React.Component {
    render() {
        return (
            <div className="dark-mode">
                <HomeIcon />
                <TopbarNavigation />
            </div>
        );
    }
}
